import React from 'react';

const TableSortToggle = (props) => {

  return (
    <div className="radio-container">
      <div className="form-check form-check-inline">
        <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="date" onChange={this.props.toggleSort} checked />
        <label className="form-check-label" for="inlineRadio1">By Date</label>
      </div>
      <div className="form-check form-check-inline">
        <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="description" onChange={this.props.toggleSort} />
        <label className="form-check-label" for="inlineRadio2">By Item</label>
      </div>
    </div>
  );
}

export default TableSortToggle;
